import React from 'react';

type TaskType = {
    task:Array<ArrayTaskType>
    name:string
}

type ArrayTaskType = {
    id:number;
    title:string;
    isDone:boolean
}


export  const ToDolist = (props:TaskType) => {


    return (

        <div>

            <h3>{props.name}</h3>
            <button>+</button>

            {props.task.map((el)=>{
            return(
                <div>{ <li key={el.id}>
                    {el.title}
                    <input  type={"checkbox"} checked={el.isDone} />
                    <button>x</button>
                </li>

                }

                </div>
            )
        })}


        </div>
    );
};
